import React from 'react'
import styles from "./Carousel.module.scss"
import degree from "../../assets/Ellipse 1icon.png";
import { ICarousel } from './ICarusel';
import { useEffect } from "react";
import { Line } from "react-chartjs-2";
import { useAppDispatch, useAppSelector } from "../../app/hook";
import { Carousel } from "react-bootstrap";
import {setCaruselList,setIsEmpty,setIsFound,setIsSearched,} from "../../app/reducers/weatherreport/weatherReportSlice"
import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Filler,
    Legend,
  } from "chart.js";
ChartJS.register(
  CategoryScale,
  LinearScale,
  PointElement,
  LineElement,
  Title,
  Tooltip,
  Filler,
  Legend
);
interface Iprops {
    caruselList : ICarousel[];
}
const Carusel =( {caruselList} :Iprops) => {
  return (
    <div className={styles.outer_wrapper}>
    <Carousel variant="dark">
      {/* item 1 */}


          <Carousel.Item  >
            hello slide 1
          </Carousel.Item>


    </Carousel>
  </div>
);
};
const CaroItem = (caroData: ICarousel) => {
  const dispatch = useAppDispatch();
  const { caruselList } = useAppSelector((state) => state.search);

  const handleRemove = (city: string) => {
    let newWishlist: ICarousel[] = caruselList.filter((item) => item.name !== city);
    console.log(newWishlist);
    if (newWishlist.length === 0) {
      dispatch(setIsEmpty(true));
      dispatch(setIsSearched(false));
      dispatch(setIsFound(false));
    } else {
      dispatch(setIsSearched(false));
      dispatch(setIsFound(false));
    }
    dispatch(setCaruselList(newWishlist));
  };
  useEffect(() => {
    console.log(caruselList);
  }, []);
  return (
    <div className={styles.info_grid}>
    {/* buttons part */}
    <section className={styles.top}>
      {/* right */}
      <div className={styles.right}>
        <button
          className={styles.btn_remove}
          onClick={() => handleRemove(caroData.name)}
        >
          Remove
        </button>
      </div>
    </section>

    {/* body part */}
    <section className={styles.wrapper}>
      {/* temp, icon and city name */}
      <div className={styles.intro}>
        <img
          src={caroData.icon}
          alt="weather-logo"
          className={styles.w_icon}
        />
        <h5 className={styles.city}>{caroData.name}</h5>
        <h5 className={styles.temp}>
          {caroData.temperature}{" "}
          <sup>
            <img src={degree} alt="celsius-logo" />
          </sup>
        </h5>
      </div>

      {/* weather details */}
      <div className={styles.details}>
        <div className={`${styles.item}`}>
          <h5>Time</h5>
          <h6>{caroData.time}</h6>
        </div>
        <div className={`${styles.item}`}>
          <h5>PRESSURE</h5>
          <h6>{caroData.pressure}</h6>
        </div>
        <div className={`${styles.item}`}>
          <h5>% RAIN</h5>
          <h6>{caroData.rain === "0.0" ? "--" : caroData.rain + "%"}</h6>
        </div>
        <div className={`${styles.item}`}>
          <h5>HUMIDITY</h5>
          <h6>{caroData.humidity}</h6>
        </div>
      </div>

      {/* weather chart and stuff */}
      <div className={styles.graph_wrap}>
        <div className={styles.day_info}>
          <h6>SUNRISE & SUNSET</h6>
          <h6 className={styles.content}>
            Length of day:{" "}
            <span style={{ color: "#2c2c2c" }}></span>
          </h6>
          <h6>
            Remaining daylight:{" "}
            <span style={{ color: "#2c2c2c" }}>

            </span>
          </h6>
        </div>

        {/* Graph plotted */}
        <div className={styles.graph}>

        </div>
      </div>
    </section>
  </div>
  )
}
const options = {
  responsive: true,
  plugins: {
    legend: {
      position: "top" as const,
    },
    title: {
      display: true,
      text: "Weather forecast for next 5 days",
    },
  },
};

interface IChartProps {
  tempList: number[];
  labels: string[];
}

const Chart = (props: IChartProps) => {
  return (
    <div style={{ width: "96%" }}>
      <Line
        options={options}
        data={{
          labels: props.labels.map((item) => item),
          datasets: [
            {
              fill: true,
              label: "Temperature",
              data: props.tempList.map((item) => item),
              borderColor: "rgb(53, 162, 235)",
              backgroundColor: "#7CC9F2",
            },
          ],
        }}
      />
    </div>
  );
};



export default Carusel
